import breakpoint from "styled-components-breakpoint";
import styled from "styled-components";

export default styled.section`
	margin-bottom: 75px;

	height: 100%;

	${({ dark }) => dark && `background-color: #1a1a1a;`}
	${({ top }) => top && `margin-top: 50px`}

	padding: 50px 0;
	${breakpoint("lg")``}

	${breakpoint("lg")`
		${({ top }) => top && `margin-top: 150px`}
		padding: 100px 0;
		margin-bottom: 150px;
	`}
`;
